// This is the Navigation Bar
import "./App.css";
import { BrowserRouter, Route, Switch } from "react-router-dom";
// import React from 'react';
import App from "./App";

function Header() {
  return (
    <BrowserRouter>
      <div className="Header">
        <Switch>
            <App />
          <h1 className="Header">
              "Hello World"
            <Route to="/App">
              <button className="Home" aria-label="Home">
                Home
              </button>
            </Route>
          </h1>
        </Switch>
      </div>
    </BrowserRouter>
  );
}

export default Header;
